import requests

# Die Bilder, die auf Live-Bild angezeigt werden.
# einfach ein base64 bild in data einf√ºgen. 

url = 'http://localhost:4000/websocket/event'

image1_base64_string = ""

image2_base64_string = ""

image_event = {
                'type': 'image',
                'data': [
                            {
                                'name': 'camera1',
                                'source': image1_base64_string
                            },
                            {
                                'name': 'camera2',
                                'source': image2_base64_string
                            },
                        ]
            }

response = requests.post(url, json=image_event)
print(f"Server response (status code): {response.status_code}")
try:
    response_json = response.json()
    print(f"Server response (JSON): {response_json}")
except requests.exceptions.JSONDecodeError:
    print("Response is not in JSON format.")
    print(f"Server response (text): {response.text}")
